.png", "InventoryNumber": "RV-518-11", "Location": "Fujian", "Theme": "Sacrificial Artifacts", "Title": "Sacrificial paper", "Period": "1876-1878 (collected", "Century": "19C", "Description": "Sacrificial paper, two pieces, the same size as no. 10; depicting the god of wealth, and to his right a graybeard, to his left a person, with a child in his arm, within a border of meanders printed in reddish brown and gold. The image represents the three"}, {"Longitude": "118.401644462194", "Latitude": "27.3542712377002", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Fujian_resized_bordered/RV-518-12.png", "InventoryNumber": "RV-518-12", "Location": "Fujian", "Theme": "Sacrificial Artifacts", "Title": "Sacrificial paper", "Period": "1876-1878 (collected", "Century": "19C", "Description": "Oblong strip of yellow, thin paper with a large number of parallel, jagged, transverse incisions; used at the graves festival; these papers are sprinkled over the burial mounds to signify that the descendants of the dead have done their duty properly"}, {"Longitude": "117.998564054459", "Latitude": "24.9573110608175", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Fujian_resized_bordered/RV-518-13.png", "InventoryNumber": "RV-518-13", "Location": "Fujian", "Theme": "Sacrificial Artifacts", "Title": "Sacrificial paper", "Period": "ca. 1877", "Century": "19C", "Description": "Offering paper depicting a seated figure in reddish-brown color, within a border of meanders. [DGr]"}, {"Longitude": "117.613261170009", "Latitude": "25.1792326737643", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Fujian_resized_bordered/RV-518-14.png", "InventoryNumber": "RV-518-14", "Location": "Fujian", "Theme": "Sacrificial Artifacts", "Title": "Sacrificial paper", "Period": "1876-1878 (collected", "Century": "19C", "Description": "Offering paper; on one side a square area covered with gold dust o ation", "Title": "Writing pen", "Period": "1886-1890", "Century": "19C", "Description": ", but\nLit.: is listed in Inventory Book 27"}, {"Longitude": "116.687018389509", "Latitude": "26.284244998599", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Fujian_resized_bordered/RV-518-15.png", "InventoryNumber": "RV-518-15", "Location": "Fujian", "Theme": "Writing and Documentation", "Title": "Examination Form", "Period": "1876-1878 (collected", "Century": "19C", "Description": "Sheet of thin paper, folded together several times of oblong, square shape, such as was issued to candidates for the Mandarin examination before its commencement; on the obverse is in blue ink the \"tjap\" or seal of the great mandarin or chief"}, {"Longitude": "118.461805634318", "Latitude": "25.7885739305961", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Fujian_resized_bordered/RV-518-16.png", "InventoryNumber": "RV-518-16", "Location": "Fujian", "Theme": "Writing and Documentation", "Title": "Examination Form", "Period": "1876-1878 (collected", "Century": "19C", "Description": "Sheet of paper as no. 15, already in use by an examinee, who has since withdrawn for some reason; the \"tjap\" of the chief examiner and the lines, through which the inside is divided into lozenges, are printed in red ink;"}, {"Longitude": "116.936135970678", "Latitude": "25.6253749572868", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Fujian_resized_bordered/RV-518-17.png", "InventoryNumber": "RV-518-17", "Location": "Fujian", "Theme": "Writing and Documentation", "Title": "Sheet of paper", "Period": "1876-1878 (collected", "Century": "19C", "Description": "Sheet of paper, one red colored side with figures of gods, pets and of a woman printed in gold. This is the representation of the kitchen god, often found, with a woman, who is busy feeding her pets; at his feet and naas"}, {"Longitude": "119.8075 com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-360-1118.png", "InventoryNumber": "RV-360-1118", "Location": "Guangdong", "Theme": "Artwork", "Title": "Back glass painting: 'Koutouen'", "Period": "1785-1790", "Century": "18C", "Description": "A special way of greeting in China was, and sometimes still is, the `koutouen.'\nKoutou, pronounced koowtoow, is literally difficult to translate.\nIt can be described as `reverent knocking with the head [on the ground]'.\nIn official greetings"}, {"Longitude": "114.74083109643", "Latitude": "24.4486895607823", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-360-1119.png", "InventoryNumber": "RV-360-1119", "Location": "Guangdong", "Theme": "Artwork", "Title": "Enjoying the fruits", "Period": "1785-1790", "Century": "18C", "Description": "A delicacy that has become well known even outside China is the litchi or lychee.\nThe litchi (Litchi chinensis; lizhi in Chinese) is a small red fruit,\nwith a prickly skin, firm pink-colored flesh and a sweet and sour taste.\nOn this skin"}, {"Longitude": "112.265140489453", "Latitude": "24.7185991058486", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-360-1120.png", "InventoryNumber": "RV-360-1120", "Location": "Guangdong", "Theme": "Artwork", "Title": "The hunt", "Period": "1785-1790", "Century": "18C", "Description": "In China, hunting as a pastime was for centuries a privilege of gentlemen\nfrom the highest circles.\nThe Chinese emperors, for example, organized large annual hunting parties\nnear their summer residence at Rehe (Jehol), north of the Great Wall.\nD"}, {"Longitude": "112.601540560087", "Latitude": "24.4679845220836", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-360-1121.png", "InventoryNumber": "RV-360-1121", "Location": "Guangdong", "Theme": "Artwork", "Title": "In the palace garden", "Period": "1785-1790", "Century": "18C", "Description": "At the center of this representation is a seated lady.\nJudging by her clothing, she is a member of the imperial family\nand probably the empress herself. Seated on a beautifully carved chair,\non a raised terrace in front of a building,"}, {"Longitude": "117.18078272934", "Latitude": "23.2903476821982", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-360-1123.png", "InventoryNumber": "RV-360-1123", "Location": "Guangdong", "Theme": "Artwork", "Title": "Kite flying along the river", "Period": "1785-1790", "Century": "18C", "Description": "A major entertainment in China, for children and adults alike, is kite flying.\nIn shape and size, kites can vary widely.\nVery popular are kites shaped like birds, insects and dragons.\nHere some children are busy from a terr"}, {"Longitude": "115.234013924651", "Latitude": "24.2926199134809", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-360-1124.png", "InventoryNumber": "RV-360-1124", "Location": "Guangdong", "Theme": "Artwork", "Title": "'All Souls'", "Period": "1785-1790", "Century": "18C", "Description": "In the Christian civilization world, there is the feast of All Souls' Day.\nDuring this feast on November 2, prayers are said for the repose of the departed.\nA similar festival is also known in China under the name of yu lan pen hui.\nOn the fifteenth da"}, {"Longitude": "113.861955693645", "Latitude": "24.3957839269041", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-360-1128.png", "InventoryNumber": "RV-360-1128", "Location": "Guangdong", "Theme": "Artwork", "Title": "On the tea plantation", "Period": "1785-1790", "Century": "18C", "Description": "In a landscape surrounded by hills and crisscrossed with waterways\na number of tea plantations are depicted in the foreground.\nVarious activities are being carried out at various locations.\nIn the background, new fields are being prepared."}, {"Longitude": "116.269688038136", "Latitude": "24.4242118967375", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-360-1129.png", "InventoryNumber": "RV-360-1129", "Location": "Guangdong", "Theme": "Artwork", "Title": "Summer garden scene", "Period": "1785-1790", "Century": "18C", "Description": "On what appears to be a balmy summer evening, somewhere in southern China ,\nan official and his wife sit on a bench on a terrace\non the banks of a wide body of water.\nAs they overlook the water, the hills on the horizon,\nadjacent won"}, {"Longitude": "110.896703288667", "Latitude": "22.6001437222908", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-360-1131.png", "InventoryNumber": "RV-360-1131", "Location": "Guangdong", "Theme": "Artwork", "Title": "Homey coziness", "Period": "1785-1790", "Century": "18C", "Description": "On a dark and cold winter day, a well-to-do Chinese family enjoys `homey coziness' in a not too large room.\nThat it is a winter scene is evident in part from the landscape.\nLeft to the background are bare frosted"}, {"Longitude": "113.608043542734", "Latitude": "24.2045580481947", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-5464-1.png", "InventoryNumber": "RV-5464-1", "Location": "Guangdong", "Theme": "Artwork", "Title": "", "Period": "", "Century": "", "Description": ""}, {"Longitude": "110.353028321", "Latitude": "20.2241679425357", "Size": "0.7", "Image URL": "https://raw.githubusercontent.com/Bouncing-Grey/Pics/main/Guangdong_resized_bordered/RV-5464-2.png", "InventoryNumber": "RV-5464-2", "Location": "Guangdong", "Theme": "Artwork", "Title": "", "Period": "", "Century": "", "Descri                                '<b>Description:</b> ' + (location.Description || '') + '</div>';
            marker.bindPopup(popupContent);
            markers.push({ marker: marker, location: location });
            return marker;
        }

        locations.forEach(function(location) {
            themes.add(location.Theme);
            var marker = createMarker(location);
            layerGroup.addLayer(marker);
        });

        // Add theme filter
        var themeSelect = document.getElementById('theme-select');
        themes.forEach(function(theme) {
            var option = document.createElement('option');
            option.value = theme;
            option.textContent = theme;
            themeSelect.appendChild(option);
        });

        themeSelect.addEventListener('change', function() {
            var selectedTheme = this.value;
            layerGroup.clearLayers();
            markers.forEach(function(item) {
                if (selectedTheme === '' || item.location.Theme === selectedTheme) {
                    layerGroup.addLayer(item.marker);
                }
            });
        });
    </script>
</body>
</html>
